var handleDataTableButtons = function () {
        "use strict";
        0 !== $("#data-table").length && $("#data-table").DataTable({
            dom: "Bfrtip",
            buttons: ["copy", "csv", "excel", "pdf", "print"],
            responsive: !0
        })
    },
    PageDemo = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableButtons()
            }
        }
    }();
